import React from "react";

import CompB from './CompB';

const CompA = (props) =>{

    const addSum = (a,b)=>{
        console.log(a+b)
    } 

    return <div className={addSum}>
     <CompB addSum={addSum}/>

    </div>
}





export default CompA;
